import React from "react";
import Slider from "./Slider";
import { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import room1 from './images/room-1.jpg'
import room2 from './images/room7.jpg'
import room3 from './images/room5.jpg'
import room4 from './images/room9.jpg'
import './components/Apartament.css'
import room5 from './images/room11.jpg'
import room6 from './images/room12.jpg'
import room7 from './images/room13.jpg'

export default function RoomDescription(){
    const data=[room1,room2,room3,room4];
    const images2=[room5,room6,room7]
    const images3=[]
    const images4=[]
    const[product,setProduct]=useState([
        {
           title:'room1',
           img:data,
           id:0
        },
        {
            title:'room2',
            img:images2,
            id:1
        },
        {
            title:'room3',
            img:images3,
            id:2
        },
        {
            title:'room4',
            img:images4,
            id:3
        }
    ])
    return(
        <div>
            {/* <Slider data={data}/> */}
            {product.map((element)=>{
                return(
                    <div key={element.id}>
                        <Slider data={element.img}/>
                    </div>
                )
            })}
            {product.find((element)=>element.id==0)}
        </div>
    )

}
